import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product card using text selector (first product)
    await page.waitForSelector('text=Apple iPhone 15 Pro Max', { timeout: 5000 });

    // Find all "Add to Cart" buttons by button text (case-insensitive, covers both grid/list)
    const addToCartButtons = await page.$$('button:has-text("Add to Cart")');

    // Rapidly click the first 3 "Add to Cart" buttons (simulate stress test)
    for (let i = 0; i < Math.min(3, addToCartButtons.length); i++) {
      await addToCartButtons[i].click();
    }

    // Screenshot after rapid add
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_rapid_add.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_rapid_add.png'));

    // Open the cart by clicking the cart area (using .cart class)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart modal or cart content to appear (look for "Your cart" or "empty-cart" or cart items)
    await page.waitForSelector('text=Your cart', { timeout: 5000 }).catch(async () => {
      // Fallback: wait for cart item image (cart-item-image)
      await page.waitForSelector('.cart-item-image', { timeout: 5000 });
    });

    // Screenshot cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal.png'));

    // Increase quantity of first cart item (find first "+" button in cart)
    const plusButtons = await page.$$('.cart-item-quantity button:has-text("+")');
    if (plusButtons.length > 0) {
      await plusButtons[0].click();
    }

    // Screenshot after increasing quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_increased_quantity.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_increased_quantity.png'));

    // Remove first item from cart (find first "Remove" button)
    const removeButtons = await page.$$('button.remove-item');
    if (removeButtons.length > 0) {
      await removeButtons[0].click();
    }

    // Screenshot after removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_after_remove.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_after_remove.png'));

    // Extract cart item titles and quantities for verification
    const cartItems = await page.$$eval('.cart-item', items =>
      items.map(item => {
        const title = item.querySelector('.cart-item-title')?.textContent?.trim() || '';
        const quantity = item.querySelector('.quantity')?.textContent?.trim() || '';
        return { title, quantity };
      })
    );

    return {
      success: true,
      action: "Performed rapid cart add, quantity change, and removal; extracted cart contents for verification.",
      extractedData: { cartItems },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
